=beginObject#inspect(from ~/.rdoc)------------------------------------------------------------------------------  obj.inspect   -> string------------------------------------------------------------------------------Returns a string containing a human-readable representation of obj. Ifnot overridden and no instance variables, uses the to_s method togenerate the string.obj.  If not overridden, uses the to_smethod to generate the string.  [ 1, 2, 3..4, 'five' ].inspect   #=> "[1, 2, 3..4, \"five\"]"  Time.new.inspect                 #=> "2008-03-08 19:43:39 +0900"=end